`,ae.jsx(t.p,{children:"The Polkadot Tooling Collective acts in the best interest of Polkadot. It tries to have a positive impact on developer success in the Polkadot Ecosystem and intends to do this by working towards two main goals:"}),`
`,ae.jsxs(t.ul,{children:[`
`,ae.jsxs(t.li,{children:["To maintain developer tools to build Polkadot ",ae.jsx(t.em,{children:"itself"})," (Core Tooling)"]}),`
`,ae.jsxs(t.li,{children:["To maintain developer tools to build ",ae.jsx(t.em,{children:"on"})," Polkadot (dApp Tooling)"]}),`
`]}),`
`,ae.jsxs(t.p,{children:["Since these definitions are not sufficiently precise, an exhaustive ",ae.jsx(t.em,{children:"Mission List"})," is provided by PoToC. This ",ae.jsx(t.em,{children:"Mission List"})," is the only source of truth about its mission."]}),`
`,ae.jsx(t.p,{children:"Similar to the Core Fellowship, one of PoToC's goals is to recognize and retain developers who make substantial contributions to these areas. Specifically, the collective should focus on people who have contributed to the specification or implementation of Polkadot tooling. Having an on-chain body will provide a means for these developers to align and organize."}),`
`,ae.jsx(t.p,{children:"PoToC may want to apply for treasury funding in the future; it is therefore clear that any infringement upon its mission statement must be treated as an attempt to exfiltrate governance funds."}),`
`,ae.jsx(t.h2,{children:"Mission List"}),`
`,ae.jsxs(t.p,{children:["The ",ae.jsx(t.em,{children:"Mission List"})," contains all projects and services that are maintained by PoToC."]}),`
`,ae.jsxs(t.p,{children:["It is divided into two sections, solely to keep the requirements of each section clearly defined; ",ae.jsx(t.em,{children:"Core"})," and ",ae.jsx(t.em,{children:"dApp"}),". It can be updated through an on-chain 2/3-majority rank-weighted vote across all Members."]}),`
`,ae.jsx(t.p,{children:"Some obvious cornerstones that must be upheld by all projects are:"}),`
`,ae.jsxs(t.ul,{children:[`
`,ae.jsx(t.li,{children:"Must be FOSS (Free and Open-Source Software)."}),`
`,ae.jsx(t.li,{children:"Source code must be accessible without a login requirement."}),`
`,ae.jsx(t.li,{children:"All members of PoToC must have permission to propose changes and raise issues."}),`
`]}),`
`,ae.jsxs(t.p,{children:["The ",ae.jsx(t.em,{children:"Mission List"})," will be defined as part of the initial seeding."]}),`
`,ae.jsx(t.h3,{children:"Core Tooling"}),`
`,ae.jsx(t.p,{children:"Generally, all tools that are used by The Fellowship to craft, test, and validate updates fall into this category. But only the tools that are predominantly developed for this cause shall be maintained by PoToC. For example, the Rust language is not predominantly developed for Polkadot; hence, it does not fit here."}),`
`,ae.jsx(t.h3,{children:"dApp Tooling"}),`
`,ae.jsxs(t.p,{children:["This category contains all tools and libraries that are used to build ",ae.jsx(t.em,{children:"on"})," Polkadot and are predominantly developed for this cause."]})]})}function Zoe(e={}){const{wrapper:t}=e.components||{};return t?ae.jsx(t,{...e,children:ae.jsx(PE,{...e})}):PE(e)}const ME=()=>ae.jsxs(ae.Fragment,{children:[ae.jsx("div",{className:"header",children:ae.jsx("h1",{children:"Collective"})}),ae.jsx("div",{style:{padding:"0 2rem 2rem"},children:ae.jsx(Zoe,{})})]});function IE(e){const t={code:"code",em:"em",h2:"h2",h3:"h3",li:"li",p:"p",ul:"ul",...e.components};return ae.jsxs(ae.Fragment,{children:[ae.jsx(t.p,{children:"The initial structure shall be as minimalistic as possible, to limit maintenance and social drama. This has the downside of being less resilient against foreign takeovers, but in the beginning, I think it is fine to rather focus on social cohesion."}),`
`,ae.jsx(t.p,{children:'There is no differentiation between maintainers of "Core Tooling" and "dApp Tooling". They both share the same set of members and rank structure. These terms are only used to clarify the mission goal.'}),`
`,ae.jsx(t.h3,{children:"Rank 0 - Candidate"}),`
`,ae.jsx(t.p,{children:"Developers who want to join can be inducted by any Member into this rank. A vote for promotion to rank 1 can be started not earlier than six months after being inducted."}),`
`,ae.jsx(t.p,{children:"They are expected to be a maintainer for one of the tools on the mission list."}),`
`,ae.jsxs(t.ul,{children:[`
`,ae.jsx(t.li,{children:"Voting weight: 0"}),`
`,ae.jsx(t.li,{children:"Salary mult: task-based bounties"}),`
`]}),`
`,ae.jsx(t.h3,{children:"Rank 1 - Member"}),`
`,ae.jsx(t.p,{children:"Members are expected to keep up the maintenance of at least one tool from the mission list. This includes extending them and creating new tools that are needed by the Polkadot developer community."}),`
`,ae.jsxs(t.ul,{children:[`
`,ae.jsx(t.li,{children:"Voting weight: 1"}),`
`,ae.jsx(t.li,{children:"Salary mult: 0.1 + task-based bounties"}),`
`]}),`
`,ae.jsx(t.h3,{children:"Further Ranks"}),`
`,ae.jsxs(t.p,{children:["The initial member seeding will show how many ranks need to be created to arrive at the correct granularity. The requirement for adding new ranks is that they are ",ae.jsx(t.em,{children:"absolutely necessary"}),"."]}),`
`,ae.jsx(t.p,{children:"We do not want to end in a situation where ranks are purely added to show off."}),`
`,ae.jsx(t.h2,{children:"Salary Structure"}),`
`,ae.jsx(t.p,{children:"There is no initial salary or bonus structure. In the future, after PoToC proves itself worthy, it is proposed to set up a bounty-centered pay structure."}),`
`,ae.jsx(t.p,{children:"Different tiers of bounties shall be defined, and a fairly low baseline salary will be paid to all members. This is done to provide an incentive for improving the tooling instead of sloth."}),`
`,ae.jsx(t.p,{children:"A member may apply for a specific bounty while providing evidence of fulfilling the bounty requirements. Granting of a bounty will be decided upon by a 50% on-chain vote. A cap on the monthly bounty payout should be established to prevent runaway spending and prioritize important changes. Bounty votes may only commence once per month to ease coordination between the Members."}),`
`,ae.jsxs(t.p,{children:["The exact constants for the size of the bounties and baseline salary will be proposed through a secondary document in ",ae.jsx(t.code,{children:"Phase II"}),"."]}),`
`,ae.jsx(t.h2,{children:"Initial Members"}),`
`,ae.jsx(t.p,{children:"There shall be a seeding repo that allows anyone to apply to a rank. Applications should include a list of tools and contributions that show their past commitment to Polkadot tooling development. The applicant must justify why they are a good fit to join PoToC."}),`
`,ae.jsx(t.p,{children:"Eventually, there needs to be a social consensus on the initial set of members. This set would then be proposed to the tokenholders, either as part of the PoToC proposal itself or as a separate referendum."}),`
`,ae.jsx(t.h2,{children:"Future"}),`
`,ae.jsx(t.p,{children:"There are a lot of questions unanswered by this document. In the beginning, we will use the Core Fellowship as a guiding light for processes and ethics as much as possible. Eventually, PoToC would develop its sub-culture (pun intended) and show more of its own identity."}),`
`,ae.jsx(t.p,{children:"A rough mid-term plan could look like this:"}),`
`,ae.jsx(t.h3,{children:"Phase I - Setup"}),`
`,ae.jsx(t.p,{children:"This phase is for setting everything up and getting it enacted on-cain. It should take at most 6 months."}),`
`,ae.jsxs(t.ul,{children:[`
`,ae.jsx(t.li,{children:"1.1 Contacting all stakeholders: Tokenholders, Seeding members, and The Fellowship."}),`
`,ae.jsx(t.li,{children:"1.2 Pitching the proposal to the community and incorporating feedback."}),`
`,ae.jsx(t.li,{children:"2.1 Crafting a preliminary implementation to ensure that all important parameters are mentioned in the proposal."}),`
`,ae.jsx(t.li,{children:"2.2 Binding governance vote via Wish-For-Change track. This is treated as the final signal on whether to pursue it or not."}),`
`,ae.jsx(t.li,{children:"3.1 Final implementation and approval by The Fellowship."}),`
`,ae.jsx(t.li,{children:"3.2 Enactment on-chain and beginning of operations."}),`
`]}),`
